import React from "react";
import { useSelector } from "react-redux";
import CinemaSysHomeMiddleItem from "../CinemaSysHomeMiddleItem";
import "./CinemaSysHomeMiddle.scss";
function CinemaSysHomeMiddle(props) {
  let listCinemaBrands = useSelector((state) => {
    return state.CinemaHome.ListCinemaBrands;
  });
  console.log(listCinemaBrands);
  return (
    <div className="tab__content__middle">
      <div className="tab__content__item">
        <div className="wp__info__tab__content clearfix">
          <a className="tab__content__item__link">
            <img src="./images/bhd_thumb.jpg" className="img-fluid" alt="anh" />
          </a>
          <div className="wp__info__tab__cinema">
            <h4 className="tab__h4__title">
              <span>BHD STAR</span> - Bitexco
            </h4>
            <span className="tab__cinema__detail">
              L3-Bitexco Icon 68, 2 Hải Triều
            </span>
            <a className="tab__link__detail">[chi tiết]</a>
          </div>
        </div>
      </div>
    </div>
  );
}

export default CinemaSysHomeMiddle;
